import Logo from './Logo';
import React from 'react';
import Cart from './Cart';

const Navigation = () => {

    return(
        <React.Fragment>
            <div className="navbar">
                <Logo>ReactMeals</Logo>
                <Cart></Cart>
            </div>
        </React.Fragment>
    )
}

export default Navigation
